import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div class="whole-nav">
      <nav className="navbar">
        <h2>Jobify</h2>
        <div>
          <Link to="/">Home</Link>
          <Link to="/jobs">Jobs</Link>
          <Link to="/dashboard">Dashboard</Link>
          <Link to="/login">Login</Link>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
